package esakkiganesh;



public class Encapsulation1 {
	 int a=10;
	private int b=5;
	protected int c=3;
	public int d=4;

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Encapsulation1 encp=new Encapsulation1();
		System.out.println(encp.a);
		System.out.println(encp.b);
		System.out.println(encp.c);
		System.out.println(encp.d);


		
	}

}
